import React, { Component } from 'react';
import PropTypes from 'prop-types';
import {Panel, Button} from "muicss/react";

class OrgLocationPanel extends Component {
    render() {
        const {location} = this.props;
        return (
            <Panel>
                <div className="panel-header pull-right">
                    <div className="switch inline">
                        <label>
                            <input type="checkbox"/>
                            <span className="lever"/>
                        </label>
                    </div>
                    <Button className="icon-button"><i className="material-icons icon-in-button">edit</i></Button>
                    <Button className="icon-button"><i className="material-icons icon-in-button danger">delete</i></Button>
                </div>
                <h3>{location.address_1}</h3>
                <h4>{location.address_2}</h4>
                <h4>{location.city}, {location.state} {location.zip}</h4>
                <h4>{location.country}</h4>
            </Panel>
        );
    }
}

OrgLocationPanel.displayName = "OrgLocationPanel";
OrgLocationPanel.propTypes = {
    location: PropTypes.object
};

export default OrgLocationPanel;
